import React from 'react'
import Theme from './Theme'
import img from '/media/nipuna/SSD FILES/Git Test/Medi-Ward-Sri-Lanka/src/Assest/mainlogo.png'

const theme=Theme();

export default function Sidebar() {
  return (
    <Box>
      <Stack justifyContent="center" alignItems="center" spacing={1}>
        <Box marginTop="20px" marginBottom="20px"><Avatar sx={{
            width:100,
            height:100,
            backgroundColor:theme.palette.background.paper,
            }} alt="Remy Sharp" src={img} />
        </Box>
        <Box sx={{width:"100%",

                }}>
            <Button sx={{
                width:"100%",
                height:80,
                backgroundColor:theme.palette.primary.dark,
                "&:hover":{
                    backgroundColor:theme.palette.secondary.main,
                }

            }}><Typography variant="h4" sx={{color:theme.palette.background.normal}}>Home</Typography></Button>
        </Box>

        <Box sx={{width:"100%",

        }}>
            <Button sx={{
                width:"100%",
                height:80,
                backgroundColor:theme.palette.primary.dark,
                "&:hover":{
                    backgroundColor:theme.palette.secondary.main,
                }

            }}><Typography variant="h4" sx={{color:theme.palette.background.normal}}>Leave Approve</Typography></Button>
        </Box>

        <Box sx={{width:"100%",

        }}>
            <Button sx={{
                width:"100%",
                height:80,
                backgroundColor:theme.palette.primary.dark,
                "&:hover":{
                    backgroundColor:theme.palette.secondary.main,
                }

            }}><Typography variant="h4" sx={{color:theme.palette.background.normal}}>News</Typography></Button>
        </Box>

        <Box sx={{width:"100%",

        }}>
            <Button sx={{
                width:"100%",
                height:80,
                backgroundColor:theme.palette.primary.dark,
                "&:hover":{
                    backgroundColor:theme.palette.secondary.main,
                }

            }}><Typography variant="h4" sx={{color:theme.palette.background.normal}}>Scheduling</Typography></Button>
        </Box>


      </Stack>
    </Box>
  )
}
